var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 個人倉儲: https://github.com/40823217/cd2021 \n 二人小組(第九組):40823201/40823217 \n 小組倉儲: stage1-bg9 、小組網站: stage1-bg9 \n 四人小組(第十一組):40823217/40823201/40823209/40823210 \n 小組倉儲: stage2-bg11 、小組網站: stage2-bg11 \n 八人小組(第二組):40823217/40823201/40823206/40823207/40823209/40823410/ \n 40823223/40823224 \n 小組倉儲: stage3-bg2 、小組網站: stage3-bg2 \n \n \n CD2021 協同產品設計實習: \n 課程簡介: 從英文單字解釋了解何謂協同(Collaborative)? 產品(product)? 設計(design)? 以及實習(practice)? 然後讓各組在討論的過成中，使用網誌建立特定時間點的設計報告資料 \n cd2021 course repository: \xa0 https://github.com/mdecourse/cd2021 \n cd2021 course discussion: \xa0 https://github.com/mdecourse/cd2021/discussions \n cd2021 gitter:\xa0 https://gitter.im/mdecourse/cd2021 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Stage1', 'text': '分組專題: \n W2-W4 (3 Weeks): 二人一組 \n W5-W9 (5 Weeks): 四人一組 \n W10-W18 (9 Weeks): 八人一組 \n 實習目的: \n \n 利用 電腦輔助機械設計套件 執行協同任務, 找出 保存各設計資料版本 的有效方法 \n 利用最有效率的方式 展示 協同產品設計過程的各相 關細節與關鍵技術 \n 實習如何協同編寫淺顯易懂且內容充實的 產品設計簡報與結案報告 \xa0 ( Reveal ) \n 在協同設計過程, 利用 \xa0 ssh \xa0 維護個人與分組倉儲與網站 \n 利用 \xa0 git remote add \xa0 建立 Github 與 Gitlab 上的同步倉儲與協同設計網站 \n \n \n 兩人小組: \n stage1-bg9:40823217/40823201 \n', 'tags': '', 'url': 'Stage1.html'}, {'title': 'W1課程說明', 'text': '1.設計分析規劃簡報 (html) 與產品設計報告書 (pdf)協同設計方法與流程, 設計結果與自評 \n 2.每週分組報告必須包含 html, pdf 與 Youtube 影片 \n \n 【2021-協同產品設計實習-stage1-bg9】 \n 專題題目: 機車的空力套件 \n \xa0(適用車型為Yamaha-Force) \n 第一位組員:40823201 \n 第二位組員:40823217 \n (類型大致像於下面兩張照片的圈起處) \n \n 圖片截至於網路上 \n', 'tags': '', 'url': 'W1課程說明.html'}, {'title': 'W2~W4', 'text': '\n 題目:機車的空力套件 \n \n 設計動機:想要藉由空力套件去切割氣流，進而減 \n 少風阻以達到騎乘時能更佳的速度，也讓整個騎乘 \n 的過程更加穩定。 \n 分工:40823217 REVEAL製作、合併網站 、 \n \xa0 \xa0 \xa0 \xa040823201 PDF檔製作、提交請求、繪製圖檔 \n 原理介紹 \n 讓 行車過程中產生的氣流避開車底，增加行車的穩定性。 讓氣體順利通過車體，避免氣體產生過多的阻力阻礙車的動力。 藉由氣體的流動增加對車子本身的下壓力，增加輪胎與地面的抓地力。 雖然如此會對行車產生阻力，但是對輕量化的車款而言，這阻力的增加 是 對操控性非常有幫助的。 \n \n \n 樣本介紹源自於 《 Kawasaki 》開發的《 H2R 》， 那源自於航空領域的深厚流體技術便化做車身的銳利擾流翼，主要是藉由 切割氣流給予車頭更多下壓力道 ，維持高速下的車身穩定性，讓速度高達可怕的 300km/h 時速下。 \n \n \n ( 圖片來源：Kawasaki) \n (從這份專利圖面來看，左右葉子板的擾流翼配置並無太大的差異，主要的作動原理是藉由切割的氣流給予車頭更多的下壓力道，維持高速下的車身穩定性，固定用的鉚釘也特別施予航空等級的打磨加工，避免激烈震盪下的滑脫狀況。 然而，以碳纖維塑形的空力設計也絕非是設計團隊的隨興之作. \n \n \n (圖片來源：careta) \n 其內容源自於kingautos: https://www.kingautos.net/60678 \n', 'tags': '', 'url': 'W2~W4.html'}, {'title': '設計概念', 'text': '\n \n 設計使用在機車上，鎖在前方後照鏡(紅色圈圈處)上的兩片風翼用來切開騎乘時所造成的風阻 \n 利用它將氣流導向兩旁，再利用機車本身的流線車形，讓氣流更快更順的通過車體 \n \n', 'tags': '', 'url': '設計概念.html'}, {'title': '成品介紹', 'text': '第一版 \n \n \n (還有一些地方需要去修改，例如:面風的那側不能這麼的平整， \n 這樣會不利於去切割氣流，還有背風面那側也要修改成較為平滑 \n 的斜面讓氣流去通過，讓車子增加一點的平穩度) \n \n 第二版 \n \n (導圓角剖面圖) \n \n \n \n 我們將面風處跟背風處都導上的圓角，讓氣流可以穩穩過 \n 然後在鎖點處挖了兩個孔，讓東西可以鎖在車上 \n', 'tags': '', 'url': '成品介紹.html'}, {'title': 'w4報告', 'text': '報告影片 \n \n', 'tags': '', 'url': 'w4報告.html'}, {'title': 'Stage2', 'text': '. \n 開始執行 Stage2 專題, 並準備在以網際 Reveal 進行簡報錄影 \n 四人小組: \n stage2-bg11:40823217/40823201/40823203/40823210 \n', 'tags': '', 'url': 'Stage2.html'}, {'title': 'w6討論主題', 'text': '主題:免彎腰販賣機 \n 分工: 40823217 合併網站、程式模擬 \n \xa0 \xa0 \xa0 \xa040823201 PDF檔製作、提交請求、網頁更新 \n \xa0 \xa0 \xa0 \xa040823210 繪製圖檔、提交請求 \n \xa0 \xa0 \xa0 \xa040823209 REVEAL製作、提交請求、影片製作 \n \n 0331討論 \n \n \n', 'tags': '', 'url': 'w6討論主題.html'}, {'title': 'w7繪製圖檔', 'text': '主題: 免彎腰販賣機 \n \n 動機:思考 到一些老人、行動不便者、受傷的人可能無法彎腰去拿取物品，所以我們 \n 將商品出口設置在右側中間。當我們買完商品時，商品即會掉落於斜面，且滾動至 \n 右側平台，而當平台偵測到重量，平台就會上升至出口處，購買者即可不必彎腰就 \n 可以拿去商品。 \n', 'tags': '', 'url': 'w7繪製圖檔.html'}, {'title': '零件圖.', 'text': '上軌道\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0\xa0鎖點支架 \n \xa0\xa0 \n \xa0  上滑軌輪 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 下軌道 \n \xa0 \xa0\xa0 \n 本體\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0位移平台 \n \xa0\xa0 \n \xa0 取物窗 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 長蜗桿 \n \xa0 \n 玻璃窗(先用一塊板子代替)\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0短蜗桿 \n \xa0 \n 置物架X3\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0滾筒X10 \n \xa0 \n 蓋\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 蜗桿支架 \n \xa0 \n \xa0 蜗桿滑塊 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 螺旋鉤子X9 \n \xa0 \n 組合圖 \n \xa0\xa0\xa0 \n 長蜗桿細節圖\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 滾筒細節圖 \n \xa0\xa0\xa0 \n \n \n \n \n', 'tags': '', 'url': '零件圖..html'}, {'title': 'Inventor模擬', 'text': '模擬者:40823210 \n \n \n \n \n', 'tags': '', 'url': 'Inventor模擬.html'}, {'title': 'w8模擬', 'text': '4/9~4/11模擬測試 \n 第一版 \n 第一次模擬 \n 一開始因為未與齒輪做連結而導致無法協調.... \n \n 第二次模擬 \n 雖然與齒輪做連結了，因為齒輪無法帶動板子上升 \n 而導致破圖，使板子上升到齒輪上面 \n \n 第三次模擬 \n 矢板子與齒輪做連結後，雖然可以透過旋轉尺齒輪來使 \n 板子上升，但與螺桿的配合還是怪怪的，然後無法上升 \n 到指定高度。之後我們將下方滾輪也讓它旋轉，使商品 \n 能滾進平台。還有上方的彈簧，讓它旋轉使商品能掉落 \n 至滾輪處。 \n \n 4/16~4/18 \n 第四次模擬 \n 修正第三次的問題後，現在可以上升至正常高度，且齒輪與蜗 \n 桿的配合也不會這麼奇怪。再來我們將商品放入了彈簧中，並 \n 讓它 旋轉後掉到滾進平台，上升到可拿取的地方。 \n \n [補充說明]:商品 再經由旋轉掉落的時候，因為會撞到外蓋的關係，所以會 直接掉 \n 到滾輪區，然後滑落，但是因為在模擬的時候蓋住外殼我 們 會看不見裡面，所 \n 以我們會將外蓋打開，以便觀看，但這也導致了，商 品失去了一個反彈的力讓 \n 它掉到滾輪區，所以變得每次都會掉出來外面， 所以我們只能將置物架設定為 \n 無碰撞，讓商品直接掉落到滾輪區，已完成這次的模擬。(詳圖如下) \n \n \n \n \n \n', 'tags': '', 'url': 'w8模擬.html'}, {'title': 'w9報告', 'text': '1.reveal: stage2-bg11/reveal \n \n 2.PDF: PDF檔 \n \n 3.Youtube: \n \n', 'tags': '', 'url': 'w9報告.html'}, {'title': 'stage3', 'text': '\n 當以兩人, 四人或八人在進行協同產品設計實習專案時, 為了讓每一位組員都必須參與各個項目的內容執行, 以 Stage3的內容而言, 共包含:\xa0 1) 動態網站維護與轉檔, 2) 倉儲內容改版與同步, 3)網際簡報編寫 , 4) 提出構想並參與討論, 5) 文獻搜尋, 6) 參數式零組件繪圖, 7) 零組件轉檔, 8) 機電系統模擬與控制, 9) 專案報告編寫與\xa0\xa0 等九個主要項目, 在任務執行期間, 應該確實讓每一位隊員都實際執行所有任務的練習. \n \n 八人小組: \n 40823217(組長)/40823201/40823206/40823207/40823209/40823210/40823223/40823224 \n', 'tags': '', 'url': 'stage3.html'}, {'title': 'W9網頁操作', 'text': '1.學會如何使用ipv4。 \n 2.利用老師給的分組名單，用程式推導出每個小組的網頁跟倉儲 \n 還有每個組員的倉儲。 \n 3.利用ipv4的[remote API]來進行遠端的操控 coppeliasim \n', 'tags': '', 'url': 'W9網頁操作.html'}, {'title': 'W10討論主題', 'text': '', 'tags': '', 'url': 'W10討論主題.html'}, {'title': 'W11直播處理', 'text': '', 'tags': '', 'url': 'W11直播處理.html'}, {'title': 'W12使用remoteapi', 'text': '', 'tags': '', 'url': 'W12使用remoteapi.html'}, {'title': 'W13小組遠端討論', 'text': '', 'tags': '', 'url': 'W13小組遠端討論.html'}, {'title': 'W14stage3進度', 'text': '', 'tags': '', 'url': 'W14stage3進度.html'}, {'title': 'W15stage3進度', 'text': '', 'tags': '', 'url': 'W15stage3進度.html'}, {'title': 'W16使用gogs及fossil', 'text': '', 'tags': '', 'url': 'W16使用gogs及fossil.html'}, {'title': 'W17', 'text': '', 'tags': '', 'url': 'W17.html'}, {'title': 'W18報告', 'text': '', 'tags': '', 'url': 'W18報告.html'}, {'title': 'W5', 'text': '2b \n \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W16', 'text': '\n', 'tags': '', 'url': 'W16.html'}, {'title': '網站影片', 'text': '第一次所設計的樣式 \n 繪圖者:40823201 \n 使用AutoCAD2017/inventor2017繪製 \n \n 網址: https://youtu.be/kwgAzh8UZUM \n \n 這是第二版，針對外型上做些修正 \n \n 網址: https://youtu.be/D-XSP2ai4Gw \n w4報告影片 \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '網站影片.html'}]};